    "<b>Exchange</b> this course for a different one": "Diesen Kurs gegen einen anderen <b>austauschen</b>",
    "<b>Get Support:</b> Our dedicated support team is available to you 24/7. You can also\n                                join Studio U, an engaged instructor community of Udemy instructors.": "<b>Volle Unterst\u00fctzung:</b> Unser freundliches Support-Team ist rund um die Uhr f\u00fcr dich da.\n                                Au\u00dferdem kannst du Mitglied bei Studio\u00a0U werden, unserer engagierten und immer hilfsbereiten Udemy-Dozenten-Community.",
    "<b>Make Money:</b> Discover your earning potential when you create your first Udemy\n                                course, build your personal brand, and inspire people around the world.": "<b>Geld verdienen:</b> Entdecke eine tolle neue M\u00f6glichkeit, Geld zu verdienen! Erstelle\n deinen ersten Udemy-Kurs, baue deine pers\u00f6nliche Marke auf und inspiriere Menschen aus allen L\u00e4ndern der Welt.",
    "<b>Note:</b> %(note)s": "<b>Hinweis:</b> %(note)s",
    "<b>Note:</b> This %(type)s is still being processed. We will send you an email when it is ready.": "<b>Hinweis:</b> Die %(type)s-Verarbeitung l\u00e4uft noch. Wir benachrichtigen dich per E-Mail, wenn die Verarbeitung abgeschlossen ist.",
    "<b>Note</b>: A document lecture is for any type of PDF document or handout for your students. You can make this a downloadable document for easy and quick reference. Make sure everything is legible and the file size is less than 1 GiB.": "<b>Hinweis</b>: Eine Dokumentlektion ist ein PDF-Dokument oder Handout (Handzettel) f\u00fcr deine Teilnehmer. Du kannst das Dokument zum Download bereitstellen, damit deine Teilnehmer es immer zur Hand haben. Achte darauf, dass alles gut lesbar ist und die Datei h\u00f6chstens 1\u00a0GB gro\u00df ist.",
    "<b>Note</b>: A presentation means slides (e.g. PowerPoint, Keynote). Slides are a great way to combine text and visuals to explain concepts in an effective and efficient way. Use meaningful graphics and clearly legible text!": "<b>Hinweis</b>: Eine Pr\u00e4sentation besteht aus Folien (z. B. PowerPoint, Keynote). In Folien lassen sich Texte und Grafiken hervorragend kombinieren, um Konzepte anschaulich darzustellen und zu erkl\u00e4ren. Achte auf aussagekr\u00e4ftige Grafiken und gut lesbaren Text.",
    "<b>Note</b>: A resource is for any type of document that can be used to help students in the lecture. This file is going to be seen as a lecture extra. Make sure everything is legible and the file size is less than 1 GiB.": "<b>Hinweis</b>: Begleitmaterialien sind alle Arten von Dokumenten, die deine Teilnehmer beim Durcharbeiten der Lektion unterst\u00fctzen. Diese Dateien gelten als Zusatz zur Lektion. Achte darauf, dass alles gut lesbar ist und die Datei h\u00f6chstens 1\u00a0GB gro\u00df ist.",
    "<b>Note</b>: All files should be at least 720p and less than 4.0 GB.": "<b>Hinweis</b>: Alle Dateien m\u00fcssen eine Aufl\u00f6sung von mindestens 720p haben und d\u00fcrfen h\u00f6chstens 4,0\u00a0GB gro\u00df sein.",
    "<b>Note</b>: An audio lecture lets your voice do the teaching. An aural experience can be useful to stimulate the imagination and promote independent visualization and knowledge association. If you use an audio lecture, make sure your audio is clean, crisp, and easy to listen to!": "<b>Hinweis</b>: Bei einer Audiolektion unterrichtest du nur mit deiner Stimme. Dies f\u00f6rdert die Vorstellungskraft, die unabh\u00e4ngige Visualisierung und die Assoziation von Wissen bei deinen Teilnehmern. Achte bei Audiolektionen darauf, dass der Ton sauber, klar und perfekt verst\u00e4ndlich ist!",
    "<b>Note</b>: Only available for Python and Ruby for now. You can upload .py and .rb files.": "<b>Hinweis</b>: Derzeit nur f\u00fcr Python und Ruby verf\u00fcgbar. Du kannst .py- und .rb-Dateien hochladen.",
    "<b>Own Your Content:</b> Own the rights to your content. Create, host, and promote your\n                                course on your own time, in your own style, all at no cost to you.": "<b>Deine Inhalte geh\u00f6ren dir:</b> Deine Inhalte sind und bleiben dein Eigentum! Du kannst deinen\n Kurs in deinem eigenen Tempo und nach deinen eigenen Vorstellungen erstellen, speichern und promoten und das Ganze kostet dich keinen Cent.",
    "<b>We use cookies</b> to give you the best online experience. By using our website, you agree to our use of cookies in accordance with our cookie policy.": "<b>Wir verwenden Cookies</b>, um die Nutzung unserer Website f\u00fcr dich so angenehm und bequem wie m\u00f6glich zu machen. Mit der Nutzung unserer Website stimmst du unserer Verwendung von Cookies gem\u00e4\u00df unserer Cookie-Richtlinie zu.",
