    "<p> Having a clear picture of your goals and aspirations for learning will help you stay motivated. Take a minute to identify these below. </p>": "<p> Eine klare Vorstellung von deinen W\u00fcnschen und Zielen beim Lernen helfen dir dabei, motiviert zu bleiben. Nimm dir einen Moment Zeit, sie hier aufzuschreiben. </p>",
    "<p>Because you have not verified your instructor account, your published courses have been disabled and de-listed from the Udemy marketplace.</p> <p>To reactivate your disabled courses, please first verify your identity and then reach out to policy@udemy.com to request reactivation of your courses.</p>": "<p>Da du die Identit\u00e4t deines Dozentenkontos nicht best\u00e4tigt hast, wurden deine ver\u00f6ffentlichten Kurse deaktiviert und werden nicht mehr auf der Udemy-Plattform angeboten.</p> <p>Um deine deaktivierten Kurse zu reaktivieren, musst du zun\u00e4chst die Identit\u00e4ts\u00fcberpr\u00fcfung erfolgreich durchlaufen und dann bei policy@udemy.com die Reaktivierung deiner Kurse anfordern.</p>",
    "<p>Congratulations! You're on your way to sharing your expertise with 12 million students around the world.</p>\n<p>We've helped thousands of instructors to plan, produce, and promote their amazing courses. Help us deliver custom tailored resources to you by answering a few quick questions:</p>": "<p>Gl\u00fcckwunsch! Du bist auf dem besten Weg, dein Wissen und K\u00f6nnen an 12\u00a0Millionen Udemy-Teilnehmer rund um den Globus weiterzugeben.</p>\n<p>Wir haben schon Tausenden von Dozenten bei Planung, Produktion und Vermarktung fantastischer Kurse geholfen. Beantworte bitte die folgenden kurzen Fragen, damit wir dich optimal unterst\u00fctzen k\u00f6nnen:</p>",
    "<p>Having a clear picture of your goals and aspirations for learning will help you stay motivated. Take a minute to identify these below.\n</p>": "<p>Eine klare Vorstellung von deinen W\u00fcnschen und Zielen beim Lernen helfen dir dabei, motiviert zu bleiben. Nimm dir einen Moment Zeit, sie hier aufzuschreiben.\n</p>",
    "<p>Having a clear picture of your goals and aspirations for learning will help you stay motivated. Take a minute to identify these below. </p>": "<p>Eine klare Vorstellung von deinen W\u00fcnschen und Zielen beim Lernen helfen dir dabei, motiviert zu bleiben. Nimm dir einen Moment Zeit, sie hier aufzuschreiben. </p>",
    "<span class=\"courses\">Course</span> has been hidden from search and recommendations due to your recent ratings.": "<span class=\"courses\">Kurs</span> wurde aufgrund der aktuellen Bewertungen aus der Suche und den Empfehlungen ausgeschlossen.",
    "<span class=\"courses\">Course</span> is at risk of being hidden from search due to recent ratings.": "<span class=\"courses\">Kurs</span> ist aufgrund der aktuellen Bewertungen gef\u00e4hrdet, aus der Suche ausgeschlossen zu werden.",
    "<span class=\"courses\">Courses</span> are at risk of being hidden from search due to recent ratings.": "<span class=\"courses\">Kurse</span> sind aufgrund der aktuellen Bewertungen gef\u00e4hrdet, aus der Suche ausgeschlossen zu werden.",
