    "A Little": "Wenig",
    "A Udemy for Business bot will post a weekly round-up of the most popular courses in your company, to a workplace group of your choosing. This will help your employees discover great content and provide social proof that learning is always happening all the time on Udemy for Business.": "Ein Udemy for Business-Bot wird eine w\u00f6chentliche \u00dcbersicht der beliebtesten Kurse in deinem Unternehmen in einer Workplace-Gruppe deiner Wahl posten. So k\u00f6nnen deine Teammitglieder tolle Kurse entdecken und gleichzeitig sehen und zeigen, welche Lernangebote bei Udemy for Business genutzt werden.",
    "A descriptive title": "Ein beschreibender Titel",
    "A frame rate of 20-30 frames per second will prevent lagging or pauses": "Eine Bildrate (Framerate) von 20\u201330 Bildern pro Sekunde verhindert Verz\u00f6gerungen oder Spr\u00fcnge.",
    "A good lecture length is 2-7 minutes, to keep students interested and help them study in short bursts. Make lectures around single topics so students can easily re-watch specific points later.": "2-7 Minuten ist eine gute L\u00e4nge f\u00fcr eine Lektion, damit die Teilnehmer interessiert und konzentriert bleiben und in kleinen \u201eH\u00e4ppchen\u201d lernen k\u00f6nnen. Behandle in jeder Lektion immer nur ein bestimmtes Thema, damit die Teilnehmer bestimmte Punkte sp\u00e4ter problemlos wiederholen k\u00f6nnen.",
    "A good microphone is the most important piece of equipment you will choose. There are lot of affordable options.. Make sure it\u2019s correctly plugged in and 6-12 inches (15-30 cm) from you.": "Ein gutes Mikrofon ist das allerwichtigste Equipment und es gibt viele geeignete Modelle, die nicht die Welt kosten. Achte darauf, dass es richtig angeschlossen und sich in 15\u201330 cm Abstand befindet.",
    "A list of all students enrolled in this course will be generated in CSV\n                format and emailed to you. This may take a few minutes if your course has a lot\n                of students. Continue?": "Es wird eine Liste aller in diesen Kurs eingeschriebenen Teilnehmer (im\n                CSV-Format) erstellt und dir per E-Mail zugesendet. Wenn in deinen Kurs viele\n                Teilnehmer eingeschrieben sind, kann dies einige Minuten dauern. Fortfahren?",
    "A little": "Etwas",
    "A maximum of 4 topics are allowed. To replace a topic, first remove one.": "Es sind h\u00f6chstens vier Themen m\u00f6glich. Wenn du ein Thema hinzuf\u00fcgen m\u00f6chten, musst du erst ein anderes Thema entfernen.",
