    "If conversion rate is lower than %s%, students are not able to find the right course, instructor, or price. Create a course that fills this gap.": "Wenn die Konversionsrate unter %s\u00a0% liegt, finden die Teilnehmer offenbar nicht den passenden Kurs, Dozenten und/oder Preis. Dies ist eine gute Gelegenheit, einen Kurs zu erstellen, der die gesuchten Merkmale bietet.",
    "If not, would you prefer captions in your own language?": "Wenn nein, h\u00e4ttest du lieber Untertitel in deiner Muttersprache?",
    "If the course contains other languages the resulting captions may be low quality. You can enable captions for this course but\n            we recommend that you first review the captions and fix any errors.": "Wenn der Kurs weitere Sprachen enth\u00e4lt, k\u00f6nnen die Untertitel von schlechter Qualit\u00e4t sein. Du kannst die Untertitel f\u00fcr diesen\n            Kurs aktivieren, wir empfehlen dir dann aber, sie zun\u00e4chst zu \u00fcberpr\u00fcfen und ggf. vorhandene Fehler zu korrigieren.",
    "If the number of courses is high, you may have to do more to stand out.": "Wenn diese Anzahl sehr hoch ist, musst du vermutlich mehr Aufwand betreiben, um deinen Kurs vom restlichen Angebot abzuheben.",
    "If there is no sound or distorted sound wipe the plug with a soft cloth and insert it fully": "Wenn kein Ton zu h\u00f6ren ist oder der Ton verzerrt ist, wische den Stecker mit einem weichen Tuch ab und stecke ihn vollst\u00e4ndig ein.",
    "If there is no sound or the message \"unable to record,\" make sure it's connected to a power source": "Wenn kein Ton zu h\u00f6ren ist oder die Fehlermeldung \u201eAufnahme nicht m\u00f6glich\u201c angezeigt wird, dann \u00fcberpr\u00fcfe, ob es an eine Stromquelle angeschlossen ist.",
    "If this box is checked, please note that you will continue to receive important transactional emails like purchase receipts.": "Wenn dieses Kontrollk\u00e4stchen aktiviert ist, erh\u00e4ltst du trotzdem weiterhin wichtige E-Mails zu durchgef\u00fchrten Transaktionen, z.\u00a0B. Kaufbest\u00e4tigungs-E-Mails.",
    "If this percentage is greater than %s% for your Topic, focus on delivering high quality content to meet high student expectations.": "Wenn dieser Anteil f\u00fcr dein Thema bei \u00fcber %s\u00a0% liegt, solltest du ganz besonders auf hochwertige Inhalte achten, da die Teilnehmer hier hohe Anspr\u00fcche an die Kursqualit\u00e4t haben.",
    "If we do not have enough courses or a diversity of instructors represented, we will not display this metric.": "Wenn nicht gen\u00fcgend Kurse oder unterschiedliche Dozenten vorhanden sind, wird diese Kennzahl nicht angezeigt.",
    "If you answered \u201cOther\u201d for either question above, please provide more detail below. ": "Wenn du auf eine der oben genannten Fragen \u201eSonstiges\u201c geantwortet hast, gib hier bitte weitere Informationen an. ",
    "If you are still unable to get results then this could be an opportunity for you to %s create Udemy's first course %s on %s.": "Wenn du nun immer noch keine Treffer hast, k\u00f6nnte dies eine gute Gelegenheit f\u00fcr dich sein, den %s allerersten Udemy-Kurs %s zum Thema \u201e%s\u201c zu erstellen.",
    "If you believe a course on Udemy infringes someone else's copyright\n                        you may want to let the rights' owner know;\n                        however, if these options do not describe your allegation please\n                        refer to our <a href=\"%(terms_url)s\">Terms</a>\n                        for assistance in resolving this issue.": "Wenn du der Ansicht bist, dass ein Kurs auf Udemy gegen das Urheberrecht\n                        einer anderen Person verst\u00f6\u00dft,\n                        kannst du diese Person davon in Kenntnis setzen. Falls die folgenden Optionen\n                        den vermuteten Tatbestand nicht beschreiben, dann informiere dich bitte in unseren <a href=\"%(terms_url)s\">Nutzungsbedingungen</a>\n                        \u00fcber die L\u00f6sungsm\u00f6glichkeiten f\u00fcr ein solches Problem.",
