    "If you could change 1 or 2 things about this course to make it better, what would you improve? (The instructor may see your response)": "Wenn du ein oder zwei Dinge an diesem Kurs verbessern k\u00f6nntest, was w\u00fcrdest du \u00e4ndern? (Der Dozent kann diese Antwort sehen.)",
    "If you create your image, it must meet our <a target=\"_blank\" rel=\"noopener noreferrer\"href=\"%(url)s\">course image quality standards</a> to be accepted.": "Achte beim Erstellen deines Bildes bitte darauf, dass es unseren <a target=\"_blank\" rel=\"noopener noreferrer\"href=\"%(url)s\">Qualit\u00e4tsstandards f\u00fcr Kursbilder</a> entspricht, damit es genehmigt wird.",
    "If you don't have any student list with you and if the course has potential to have students, then Udemy is a fantastic platform to kick-start your online career.": "Wenn du noch keine Teilnehmerlisten hast und dein Kurs ein gutes Teilnehmerpotenzial hat, dann ist Udemy die perfekte Plattform f\u00fcr den Start deiner Online-Karriere!",
    "If you exit, your test video will not be submitted and you won't receive feedback. Are you sure you want to exit?": "Wenn du jetzt beendest, wird dein Testvideo nicht eingereicht und du erh\u00e4ltst kein Feedback. M\u00f6chtest du wirklich beenden?",
