    "If you have a Udemy for Business account associated with <strong>%s</strong>, we will send a verification link. This will bring you to your account.": "Wenn du \u00fcber ein Udemy for Business-Konto verf\u00fcgst, das mit <strong>%s</strong> verkn\u00fcpft ist, senden wir dir einen Best\u00e4tigungs-Link zu, \u00fcber den du in dein Konto gelangst.",
