    "Once you publish your course, you can grow your student audience and make an impact with the support of Udemy's marketplace promotions and also through your own marketing efforts. Together, we\u2019ll help the right students discover your course.": "Nachdem du deinen Kurs auf Udemy ver\u00f6ffentlicht hast, kannst du mithilfe der Udemy-Werbeaktionen und deiner eigenen Marketingkampagnen deine Zielgruppe erweitern und neue Teilnehmer gewinnen. Wir sorgen gemeinsam daf\u00fcr, dass dein Kurs genau den richtigen Teilnehmern angeboten wird.",
