    "This is the survey that was previously stored in the InstructorSurvey Model.   We got rid of that and are now using standard surveys.  This is used to access the old data we collected previously.": "Diese Umfrage wurde vorher im InstructorSurvey-Modell gespeichert. Wir haben es entfernt und verwenden jetzt Standardumfragen. Diese werden f\u00fcr den Zugriff auf alte Daten verwendet, die wir vorher erfasst haben.",
    "This is the total number of enrollments across your published and unpublished courses. For example, if a student is enrolled in two of your courses, that student counts for two enrollments.": "Dies ist die Gesamtanzahl von Einschreibungen in deinen ver\u00f6ffentlichten und zur\u00fcckgezogenen Kursen. Wenn ein Teilnehmer z. B. in zwei deiner Kurse eingeschrieben ist, z\u00e4hlt dies als zwei Einschreibungen.",
    "This is the total number of enrollments in your course.": "Dies ist die Gesamtanzahl von Einschreibungen in deinen Kurs.",
    "This is the unique number of students across your published and unpublished courses. If a student is enrolled in two or more of your courses, the student is only counted once.": "Dies ist die Gesamtanzahl von Personen, die als Teilnehmer in deine ver\u00f6ffentlichten und zur\u00fcckgezogenen Kursen eingeschrieben sind. Teilnehmer, die in mehrere deiner Kurse eingeschrieben sind, werden nur einmal gez\u00e4hlt.",
    "This is your moment! If you\u2019ve structured your course and used our guides, you're well prepared for the actual shoot. Pace yourself, take time to make it just right, and fine-tune when you edit. ": "Es kann losgehen! Wenn du deinen Kurs gut strukturiert und dich an unseren Infomaterialien orientiert hast, dann bist du gut f\u00fcr die Filmaufnahmen vorbereitet. Finde dein Tempo und nimm dir gen\u00fcgend Zeit, damit alles wirklich nach deinen Vorstellungen gelingt. Um die Kleinigkeiten kannst du dich sp\u00e4ter bei der Bearbeitung k\u00fcmmern. ",
