    "We are excited for you to take your courses; however, this payment method may \n                               take up to 5 business days to process. As soon as it processes we will email you\n                               a confirmation with access to your courses so you can get back to learning!": "Super, dass du Kurse belegen m\u00f6chtest! Wir m\u00f6chten dich aber darauf hinweisen, \n dass die Zahlungsverarbeitung bei dieser Methode bis zu f\u00fcnf Gesch\u00e4ftstage dauern \n kann. Du wirst sofort nach der Verarbeitung mit einer E-Mail benachrichtigt, \u00fcber die \n du auf deine Kurse zugreifen kannst, damit du loslegen kannst!",
    "We are extending your preview": "Deine Vorschau wird verl\u00e4ngert.",
    "We can provide tips for multiple aspects of your video. Students value both your filming quality and on-screen presence!": "Wir k\u00f6nnen dir zu verschiedensten Aspekten deines Videos Tipps geben. Unsere Teilnehmern achten sehr auf gute Aufnahmequalit\u00e4t und Bildschirmpr\u00e4senz!",
    "We check production so you can focus on instruction": "Wir \u00fcberpr\u00fcfen die technische Qualit\u00e4t, damit du dich voll und ganz aufs Unterrichten konzentrieren kannst.",
    "We couldn't add this item.": "Dieser Artikel konnte nicht hinzugef\u00fcgt werden.",
    "We couldn't find the content you searched for. Try searching for the name of a lecture or resource.": "Der gesuchte Inhalt konnte leider nicht gefunden werden. Du kannst versuchen, nach dem Namen einer Lektion oder eines Materials zu suchen.",
    "We couldn't retrieve the channel list from Slack. Try re-typing your search if you want to share to a channel": "Die Channel-Liste konnte nicht von Slack abgerufen werden. Gib deinen Suchbegriff bitte noch einmal ein, wenn du etwas in einem Channel teilen willst.",
    "We couldn't retrieve the user list from Slack. Try re-typing your search if you want to share directly to a user": "Die Nutzerliste konnte nicht von Slack abgerufen werden. Gib deinen Suchbegriff bitte noch einmal ein, wenn du etwas direkt mit einem Nutzer teilen willst.",
    "We couldn't retrieve the users or channel list from Slack. Try re-typing your search": "Die Nutzer- bzw. Channel-Liste konnte nicht von Slack abgerufen werden. Gib deinen Suchbegriff bitte noch einmal ein.",
    "We didn't find any match": "Leider keine Treffer gefunden",
    "We failed to fetch user information from the server. Please refresh the page.": "Die Nutzerinformationen konnten nicht vom Server abgerufen werden. Bitte lade die Seite neu.",
    "We have multiple formats you can use to create your course.\n                    Teach in the style that makes sense for your topic and personality.": "Du kannst in deinem Kurs verschiedene Formate verwenden und\n                    in deinem pers\u00f6nlichen Stil unterrichten, der zu deinem Thema und deiner Pers\u00f6nlichkeit passt.",
    "We have started providing automatically generated captions for courses in English. You will receive a notification when any of your courses has been captioned. We recommend using the new Caption Editing Tool to review the captions and fix any errors. If lectures already have instructor-provided captions then these will take precedence over the auto-generated captions. <a class=\"captionInfoLink\">Learn More.</a>": "Wir haben begonnen, Kurse in englischer Sprache mit automatisch erzeugten Untertiteln zu versehen. Wenn einer oder mehrere deiner Kurse mit Untertiteln versehen wurden, wirst du dar\u00fcber benachrichtigt. Wir empfehlen, diese Untertitel mit dem neuen Untertitelbearbeitungs-Tool zu \u00fcberpr\u00fcfen und ggf. vorhandene Fehler zu korrigieren. Wenn Lektionen schon mit vom Dozenten bereitgestellten Untertiteln versehen sind, haben diese Vorrang vor automatisch erzeugten Untertiteln. <a class=\"captionInfoLink\">Weitere Infos.</a>",
    "We hope you enjoy your courses, %(name)s!": "Wir hoffen, dass dir deine Kurse gefallen, %(name)s!",
    "We offer thousands of courses to millions of students thanks to dedicated people like you. Courses can be short 30 minute overviews or a deep dive into your topic. You can teach in your own style.": "Wir bieten Tausende von Kursen f\u00fcr Millionen von Teilnehmern \u2013 weil es tolle, engagierte Dozenten wie dich gibt! Ein Kurs kann eine 30-min\u00fctige Kurzeinf\u00fchrung, ein fundierter Intensivkurs oder irgendetwas dazwischen sein. Du kannst deinen Kurs nach deinen eigenen Vorstellungen gestalten und unterrichten!",
    "We recommend reviewing these captions for errors. You can easily edit and improve captions by clicking Edit to launch \n            Udemy's Caption Editing Tool.": "Wir empfehlen, diese Untertitel auf Fehler zu \u00fcberpr\u00fcfen. Du kannst Untertitel ganz einfach bearbeiten und verbessern. \n            Klicke einfach auf \u201eBearbeiten\u201c, um das Udemy-Tool zur Bearbeitung von Untertiteln zu \u00f6ffnen.",
    "We recommend reviewing with us before filming a course, and whenever you use something new or move locations.": "Wir empfehlen dir, vor dem Aufnehmen eines Kurses und auch immer dann, wenn du ein neues Ger\u00e4t verwendest oder einen anderen Aufnahmeort w\u00e4hlst, ein Testvideo einzureichen.",
    "We want you to love every course you take on Udemy. If it's not\n                           right, you have 30 days to return or exchange it.": "Uns ist es wichtig, dass du mit jedem Udemy-Kurs absolut zufrieden bist. \n                           Wenn dir der Kurs nicht gef\u00e4llt, kannst du ihn innerhalb von 30 Tagen zur\u00fcckgeben oder gegen einen anderen austauschen.",
    "We want you to love every course you take on Udemy. If it's not\n                       right, you have 30 days to return or exchange it.": "Uns ist es wichtig, dass du mit jedem Udemy-Kurs absolut zufrieden bist.\n Wenn dir der Kurs nicht gef\u00e4llt, kannst du ihn innerhalb von 30 Tagen zur\u00fcckgeben oder gegen einen anderen austauschen.",
    "We were unable to automatically verify your identity after\n                    three attempts. Please instead verify your identity through the\n                    alternative process described below. <strong>Please submit your video\n                    within 30 days in order to keep your account active.</strong>": "Deine Identit\u00e4t konnte in drei Versuchen nicht automatisch best\u00e4tigt werden.\n                    Best\u00e4tige deine Identit\u00e4t daher bitte mit dem unten\n                    beschriebenen alternativen Prozess. <strong>Sende dein Video bitte\n                    innerhalb von 30\u00a0Tagen ein, damit dein Konto aktiv bleibt.</strong>",
    "We will email you (%s) when your report is ready for download.": "Wir benachrichtigen dich per E-Mail (%s), wenn der Bericht zum Download verf\u00fcgbar ist.",
    "We will use these to personalize your home page. Don't worry you can change them later.": "Diese werden zur Personalisierung deiner Homepage verwendet. Du kannst sie nat\u00fcrlich jederzeit \u00e4ndern!",
    "We'd love to help you learn something new": "Wir w\u00fcrden dir gerne helfen, etwas Neues zu lernen",
