    "What I liked especially was the encouragement to get my course online - services like the course image design service, feedback on test videos and instructor peer forum.": "Besonders toll fand ich die viele Unterst\u00fctzung bei der Ver\u00f6ffentlichung meines Kurses, z.\u00a0B. das Kursbilddesign-Service, das Feedback zu den Testvideos und die Dozenten-Community!",
