    "When students finish your course, you have the option of providing\n                            them with a digital certificate of completion containing your company logo.": "Du kannst Teilnehmern, die deinen Kurs abgeschlossen haben, eine\n digitale Abschlussbescheinigung mit deinem Unternehmenslogo ausstellen.",
    "When students finish your course, you have the option of providing\n                        them with a digital certificate of completion containing your company logo.": "Du kannst Teilnehmern, die deinen Kurs abgeschlossen haben, eine\n digitale Abschlussbescheinigung mit deinem Unternehmenslogo ausstellen.",
    "When the LED above the logo glows red it's ready": "Wenn die LED \u00fcber dem Logo rot leuchtet, kannst du loslegen.",
    "When you add video lectures to your course via the <a href=\"%(curriculumUrl)s\">Curriculum</a> you will be able to add captions to those videos here.": "Wenn du Videolektionen \u00fcber den <a href=\"%(curriculumUrl)s\">Lehrplan</a> zu deinem Kurs hinzuf\u00fcgst, kannst du diese Videos hier mit Untertiteln versehen.",
    "When your filter is set to All Courses, all courses you teach are excluded from the list.": "Wenn du den Filter f\u00fcr \u201eAlle Kurse\u201c setzt, werden alle von dir unterrichteten Kurse aus der Liste ausgeschlossen.",
    "When your filter is set to All Courses, all topics you teach are excluded from the list.": "Wenn du den Filter f\u00fcr \u201eAlle Kurse\u201c setzt, werden alle von dir unterrichteten Themen aus der Liste ausgeschlossen.",
    "When your filter is set to a specific course, only that course is excluded from the list.": "Wenn du den Filter f\u00fcr einen bestimmten Kurs setzt, wird nur dieser Kurs aus der Liste ausgeschlossen.",
    "When your filter is set to a specific course, only the topic of that course is excluded from the list.": "Wenn du den Filter f\u00fcr einen bestimmten Kurs setzt, wird nur das Thema dieses Kurses aus der Liste ausgeschlossen.",
    "When your videos are ready, you can publish your course to our marketplace. You can see how your course is performing and engage with students using our analytics and communication tools.": "Wenn deine Videos fertig sind, kannst du deinen Kurs auf unserer Plattform ver\u00f6ffentlichen. Du kannst dann mit unseren Analyse-Tools verfolgen, wie dein Kurs l\u00e4uft, und unsere Kommunikations-Tools nutzen, um dich mit deinen Teilnehmern auszutauschen und in Kontakt zu bleiben.",
    "Where should Udemybot post?": "In welcher Gruppe soll der Udemybot posten?",
    "Whether you've been teaching for years or are teaching for the first time, you can make an engaging course. We've compiled resources and best practices to help you get to the next level, no matter where you're starting.": "Du unterrichtest schon seit Jahren? Oder du steigst gerade neu ein? Auf Udemy kann jeder einen \u00fcberzeugenden Kurs auf die Beine stellen! Wir unterst\u00fctzen dich mit jeder Menge Infomaterialien und Profi-Tipps f\u00fcr alle Erfahrungsstufen.",
    "Which category best describes your course topic area?": "Welche Kategorie beschreibt den Bereich deines Kursthemas am besten?",
    "Which of the following best describes your experience?": "Welche der folgenden Angaben beschreibt deine Erfahrung am besten?",
    "Which of the following statements most describes how and why you decided to create a course on Udemy?": "Welche der folgenden Angaben beschreibt am besten, wie und warum du einen Kurs auf Udemy erstellen m\u00f6chtest?",
    "Which topic do you spend the most time covering in your course? If you believe two topics are equally\n                            representative of your entire course, select either one. All of the topics listed will still count as being taught in\n                            your course.": "Welches Thema wird in deinem Kurs am ausf\u00fchrlichsten behandelt? Wenn deiner Meinung nach zwei\n                            Themen gleich repr\u00e4sentativ f\u00fcr den Kurs sind, w\u00e4hle bitte eines davon aus. Alle aufgef\u00fchrten Themen gelten nat\u00fcrlich weiterhin\n                            als behandelte Kursthemen.",
